import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


/**
 * 
 */
const footerMain = {
    backgroundColor: "blue",
    padding: "3em",
    color: "white",
    position: "absolute",
    width: "100%",
    bottom: "0"
}

const Footer = () => {
    return <footer style={footerMain}>



        <i className="fa fa-cloud"></i>
        <i class='fas fa-share-alt' style={{ fontSize: '36px' }}></i>
        <i class="material-icons" style="font-size:36px">share</i>
        Footer
    </footer>;
}


// #endregion

export default Footer;
